import React, { Component } from "react";

class BlogList extends Component {
    render () {
        const blogs = this.props.blogs;
        return (
            blogs.map(blog => (
            <div>
                <strong>{blog.title}</strong>
                <br />
                <hr />
                {blog.created}
                <br />
                {blog.text}
                <br />
                <hr />
            </div>
            ))
        );
    }
}
export default BlogList;
